              <button
                style={{
                  width: 215,
                  background: "#FFFFFF",
                  color: "#606060",
                  height: 210,
                  border: "1px solid #E5E5E5",
                  borderRadius: 20,
                  fontSize: 24,
                  fontWeight: 600,
                  marginRight: 80,
                }}
                onClick={() => setType(3)}
              >
                <img
                  src={Cancle}
                  alt="Cancle"
                  style={{ width: "50%", height: "40%" }}
                />
                <br />
                <br />
                <p>CANCLE</p>
              </button>

              <div
                style={{
                  textAlign: "left",
                  position: "absolute",
                  top: 245,
                  width: "fit-content",
                }}
              >
                <TableContainer component={Paper}>
                  <Table sx={{ minWidth: 1090 }}>
                    <TableHead style={{ background: "#263238" }}>
                      <TableRow>
                        <TableCell align="center" style={{ color: "#FFFFFF" }}>
                          Order ID
                        </TableCell>
                        <TableCell align="center" style={{ color: "#FFFFFF" }}>
                          Order type
                        </TableCell>
                        <TableCell align="center" style={{ color: "#FFFFFF" }}>
                          Order name
                        </TableCell>
                        <TableCell align="center" style={{ color: "#FFFFFF" }}>
                          Translator
                        </TableCell>
                        <TableCell align="center" style={{ color: "#FFFFFF" }}>
                          Order price
                        </TableCell>
                        <TableCell align="center" style={{ color: "#FFFFFF" }}>
                          Ordered date
                        </TableCell>
                        <TableCell align="center" style={{ color: "#FFFFFF" }}>
                          Status
                        </TableCell>
                      </TableRow>
                    </TableHead>
                    <TableBody>
                      {rows.map((row) => (
                        <TableRow
                          key={row.orderID}
                          sx={{
                            "&:last-child td, &:last-child th": { border: 0 },
                          }}
                        >
                          <TableCell component="th" scope="row">
                            {row.orderID}
                          </TableCell>
                          <TableCell align="center">{row.orderType}</TableCell>
                          <TableCell align="center">{row.orderName}</TableCell>
                          <TableCell align="center">{row.translator}</TableCell>
                          <TableCell align="center">{row.orderPrice}</TableCell>
                          <TableCell align="center">
                            {row.orderedDate}
                          </TableCell>
                          {row.status === "Succeed" ? (
                            <TableCell
                              align="center"
                              style={{ color: "#46BC52" }}
                            >
                              {row.status}
                            </TableCell>
                          ) : row.status === "Cancle" ? (
                            <TableCell
                              align="center"
                              style={{ color: "#CF0202" }}
                            >
                              {row.status}
                            </TableCell>
                          ) : (
                            <TableCell align="center">{row.status}</TableCell>
                          )}
                        </TableRow>
                      ))}
                    </TableBody>
                  </Table>
                </TableContainer>
              </div>
            </>
          ) : null}
        </div>
      </Box>
    </div>
  );
}
